import React from "react";
import "./css/style.css";

class ContactPage extends React.Component {
  // constructor(props) {
  //   super(props);
  // }

  render() {
    return (
      <div className="uk-position-center uk-width-2-3@s uk-width-2-3@m">
        <article className="uk-article  uk-row-first uk-align-center uk-margin-large-bottom">
          <div className="uk-width-1-1 uk-row-first uk-margin-large-bottom">
            <p className=" uk-heading-small">Contact</p>
          </div>

          <p className="uk-text-justify">
            If you enjoy my work and have any queries or questions, why not get
            in contact?
          </p>

          <p className="uk-text-justify uk-text-muted">
            <i>danielrdhr@gmail.com</i>
          </p>

          <p className="uk-text-justify">
            Why not also follow me on social media?
          </p>

          <ul className="uk-list uk-list-bullet">
            <li>
              {" "}
              <a
                className="uk-link-text"
                href="https://www.instagram.com/javawax"
                target="_blank"
              >
                Instagram
              </a>{" "}
            </li>
            <li>
              {" "}
              <a className="uk-link-text" href="#">
                Facebook
              </a>{" "}
            </li>
          </ul>

          <p className="uk-article-meta uk-text-capitalize  uk-text-small uk-width-2-3@s" />
        </article>
      </div>
    );
  }
} //END OF CLASS

export default ContactPage;
